import React, { Component } from 'react';

interface nft_list_props {
  list: any;
}

class NFT_List extends Component<nft_list_props,nft_list_props>{

    constructor(props: nft_list_props) {
        super(props);
        this.state = {
          list: props.list
        };
    }

    render() {
        return (
        <div className="container">
            <h3 className="p-3 text-center">List of NFTs</h3>
            <table className="table table-striped table-bordered">
                <thead>
                    <tr>
                        <th>Stock</th>
                        <th>Price</th>
                        <th>Address</th>
                    </tr>
                </thead>
                <tbody>
                    {this.props.list && this.props.list.map((nft: any) =>
                        <tr key={nft.id}>
                            <td>{nft.stock}</td>
                            <td>{nft.price}</td>
                            <td>{nft.address}</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
        );

    }
}

export default NFT_List;
